    "2013-03-19T00:29:42.587540",nt"name": "survey-of-geology-geologic-materials-and-geologic-hazards-in-proposed-access-corridors-in-selec",nt"isopen":
    false,nt"url": null,nt"notes": "As part of the Department of Natural Resources
    (DNR) effort to make final recommendations of federal land parcels to be considered
    for selection by the State of Alaska according to provisions of the Statehood Act,
    a decision was made to identify and evaluate potential access corridors. Corridor
    maps were compiled for a total of 78 quadrangles throughout Alaska. This map suite
    shows relevant geologic information at a scale of 1:250,000 for 10-mile-wide corridors
    straddling centerlines for proposed access routes throughout Alaska. The maps are
    based on geologic data compiled from existing, published mapping. Each compiled
    corridor geology map was used to derive maps of potential construction materials,
    data quality, and geologic hazards. A second geologic-hazards map shows non-derivative
    potential hazards compiled from published maps and reports, including faults, icings,
    avalanches, jokulhlaups, and permafrost.",nt"license_title": null,nt"extras":
